import{_ as o,a as r,b as d,c as i}from"./chunks/kakuteh7_debug_swd_port.B-2Xie2S.js";import{_ as l,c as s,j as e,a as h,G as n,a8 as p,B as u,o as c}from"./chunks/framework.BDnHobkS.js";const x=JSON.parse('{"title":"Holybro Kakute H7","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/kakuteh7.md","filePath":"ko/flight_controller/kakuteh7.md"}'),m={name:"ko/flight_controller/kakuteh7.md"};function b(k,t,f,g,S,y){const a=u("Badge");return c(),s("div",null,[t[0]||(t[0]=e("h1",{id:"holybro-kakute-h7",tabindex:"-1"},[h("Holybro Kakute H7 "),e("a",{class:"header-anchor",href:"#holybro-kakute-h7","aria-label":'Permalink to "Holybro Kakute H7"'},"​")],-1)),n(a,{type:"tip",text:"PX4 v1.13"}),t[1]||(t[1]=p('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The <a href="https://holybro.com/products/kakute-h7" target="_blank" rel="noreferrer">Holybro Kakute H7</a> is full of features including dual plug-and-play 4in1 ESC ports, HD camera plug, barometer, OSD, 6x UARTs, full Blackbox MicroSD card slot, 5V and 9V BEC, easy soldering layout, and much more.</p><p>The Kakute H7 builds upon the best features of its predecessor, the <a href="./../flight_controller/kakutef7.html">Kakute F7</a>, and further improves on hardware components and layout. Dual plug&#39;n&#39;play 4-in-1 ESC connectors simplify support for x8 and Octocopter configurations, keeping assembly simple and clean.</p><p>The board also has an on-board barometer, LED &amp; buzzer pad, and I2C pad (SDA &amp; SCL) for external GPS/Magnetometers.</p><p><img src="'+o+'" alt="Kakute h7"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="주요-특징" tabindex="-1">주요 특징 <a class="header-anchor" href="#주요-특징" aria-label="Permalink to &quot;주요 특징&quot;">​</a></h2><ul><li>MCU: STM32H743 32-bit processor running at 480 MHz</li><li>IMU: MPU6000</li><li>Barometer: BMP280</li><li>OSD: AT7456E</li><li>Onboard Bluetooth chip: Disabled with PX4</li><li>2x JST-SH1.0_8pin port (For Single or 4in1 ESCs, x8/Octocopter plug &amp; play compatible)</li><li>1x JST-GH1.25_6pin port (For HD System like Caddx Vista &amp; Air Unit)</li><li>Battery input voltage: 2S - 8S</li><li>BEC 5V 2A Cont.</li><li>BEC 9V 1.5A Cont.</li><li>Mounting: 30.5 x 30.5mm/Φ4mm hole with Φ3mm Grommets</li><li>Dimensions: 35x35mm</li><li>Weight: 8g</li></ul><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p>The board can be bought from one of the following shops (for example):</p><ul><li><a href="https://holybro.com/products/kakute-h7" target="_blank" rel="noreferrer">Holybro</a></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The <em>Kakute H7</em> is designed to work with the <em>Tekko32</em> 4-in-1 ESC and they can be bought in combination.</p></div><h2 id="커넥터-및-핀" tabindex="-1">커넥터 및 핀 <a class="header-anchor" href="#커넥터-및-핀" aria-label="Permalink to &quot;커넥터 및 핀&quot;">​</a></h2><p>This is the silkscreen for the <em>Kakute H7</em>, showing the top of the board:</p><img src="'+r+'" width="380px" title="Kakute h7"><table tabindex="0"><thead><tr><th>핀</th><th>기능</th><th>기본값</th></tr></thead><tbody><tr><td>B+</td><td>Battery positive voltage (2S-8S)</td><td></td></tr><tr><td>SDA, SCL</td><td>I2C 연결(주변장치용)</td><td></td></tr><tr><td>5V</td><td>5V 출력 (최대 2A)</td><td></td></tr><tr><td>3V3</td><td>3.3V output (0.25A max)</td><td></td></tr><tr><td>VI</td><td>FPV 카메라의 비디오 입력</td><td></td></tr><tr><td>VO</td><td>비디오 송신기로 비디오 출력</td><td></td></tr><tr><td>CAM</td><td>To camera OSD control</td><td></td></tr><tr><td>G 또는 GND</td><td>접지</td><td></td></tr><tr><td>RSI</td><td>수신기에서 아날로그 RSSI(0-3.3V) 입력</td><td></td></tr><tr><td>R1, T1</td><td>UART1 RX 및 TX</td><td>TELEM1</td></tr><tr><td>R3, T3</td><td>UART3 RX 및 TX</td><td>NuttX 디버그 콘솔</td></tr><tr><td>R4, T4</td><td>UART4 RX 및 TX</td><td>GPS1</td></tr><tr><td>R6, T6</td><td>UART6 RX and TX (R6 also located in the GH plug)</td><td>RC 포트</td></tr><tr><td>R7</td><td>UART7 RX (RX is located in the plugs for use with 4-in-1 ESCs)</td><td>DShot 텔레메트리</td></tr><tr><td>LED</td><td>WS2182 주소 지정이 가능한 LED 신호 와이어(테스트되지 않음)</td><td></td></tr><tr><td>Z-</td><td>피에조 부저 네거티브 레그(부저 포지티브 레그를 5V 패드에 연결)</td><td></td></tr><tr><td>M1에서 M4</td><td>모터 신호 출력 (4-in-1 ESC에서 사용하기 위해 플러그에 위치)</td><td></td></tr><tr><td>M5 to M8</td><td>모터 신호 출력 (4-in-1 ESC에서 사용하기 위해 플러그에 위치)</td><td></td></tr><tr><td>Boot</td><td>부트로더 버튼</td><td></td></tr></tbody></table><h2 id="bootloader" tabindex="-1">PX4 Bootloader Update <a class="header-anchor" href="#bootloader" aria-label="Permalink to &quot;PX4 Bootloader Update {#bootloader}&quot;">​</a></h2><p>The board comes pre-installed with <a href="https://github.com/betaflight/betaflight/wiki" target="_blank" rel="noreferrer">Betaflight</a>. Before PX4 firmware can be installed, the <em>PX4 bootloader</em> must be flashed. Download the <a href="https://github.com/PX4/PX4-user_guide/raw/main/assets/flight_controller/kakuteh7/holybro_kakuteh7_bootloader.hex" target="_blank" rel="noreferrer">kakuteh7_bl.hex</a> bootloader binary and read <a href="./../advanced_config/bootloader_update_from_betaflight.html">this page</a> for flashing instructions.</p><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">make</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> holybro_kakuteh7_default</span></span></code></pre></div><h2 id="펌웨어-설치" tabindex="-1">펌웨어 설치 <a class="header-anchor" href="#펌웨어-설치" aria-label="Permalink to &quot;펌웨어 설치&quot;">​</a></h2><p>펌웨어는 일반적인 방법으로 설치할 수 있습니다.</p><ul><li><p>소스 빌드 및 업로드</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">make</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> holybro_kakuteh7_default</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> upload</span></span></code></pre></div></li><li><p><a href="./../config/firmware.html">Load the firmware</a> using <em>QGroundControl</em>. 미리 빌드된 펌웨어나 사용자 지정 펌웨어를 사용할 수 있습니다.</p></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If you are loading the pre-built firmware via QGroundcontrol, you must use QGC Daily or QGC version newer than 4.1.7.</p></div><h2 id="px4-설정" tabindex="-1">PX4 설정 <a class="header-anchor" href="#px4-설정" aria-label="Permalink to &quot;PX4 설정&quot;">​</a></h2><p>In addition to the <a href="./../config/">basic configuration</a>, the following parameters are important:</p><table tabindex="0"><thead><tr><th>매개변수</th><th>설정</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#SYS_HAS_MAG">SYS_HAS_MAG</a></td><td>보드에 내부 자력계가 없기 때문에 비활성화하여야 합니다. 외부 자력계를 연결하여 활성화 할 수 있습니다.</td></tr></tbody></table><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>TELEM1</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM2</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>디버그 콘솔</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>RC SBUS</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>ESC 텔레메트리(DShot)</td></tr></tbody></table><h3 id="using-telem2-usart2" tabindex="-1">Using TELEM2 (USART2) <a class="header-anchor" href="#using-telem2-usart2" aria-label="Permalink to &quot;Using TELEM2 (USART2)&quot;">​</a></h3><p>The <code>TELEM2</code> port (USART2) has no exposed solder pads as it is intended for use with Bluetooth telemetry (this does not work with PX4).</p><p>You can expose the solder pads and use the port by removing the two resistors marked with an X. No other configuration should be required.</p><img src="'+d+'" width="380px" title="Kakute h7"><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><h3 id="시스템-콘솔" tabindex="-1">시스템 콘솔 <a class="header-anchor" href="#시스템-콘솔" aria-label="Permalink to &quot;시스템 콘솔&quot;">​</a></h3><p>UART3 RX and TX are configured for use as the <a href="./../debug/system_console.html">System Console</a>.</p><h3 id="swd" tabindex="-1">SWD <a class="header-anchor" href="#swd" aria-label="Permalink to &quot;SWD&quot;">​</a></h3><p>The <a href="./../debug/swd_debug.html">SWD interface</a> (JTAG) pins are:</p><ul><li><code>SWCLK</code>: Test Point 2 (Pin 72 on the CPU)</li><li><code>SWDIO</code>: Test Point 3 (Pin 76 on CPU)</li><li><code>GND</code>: As marked on board</li><li><code>VDD_3V3</code>: As marked on board</li></ul><p>These are shown below.</p><p><img src="'+i+'" alt="SWD Pins on Kakute H7 - CLK SWO"></p>',42))])}const P=l(m,[["render",b]]);export{x as __pageData,P as default};
